import React, { Component } from 'react'
import Footer from "../layout/Footer";
import Header from "../layout/Header";
import Sidebar from "../layout/Sidebar";
const axios = require("axios").default;

class TeamLeader extends Component {
    constructor(props) {
        super(props);
        this.state = {
            Employee: {
                employee_code: "",
                employee_name: "",
            },
            resStatus: {
                isError: false,
                messages: "",
            },
            employeeList: []
        };
        this.handleChange = this.handleChange.bind(this);
        this.submitForm = this.submitForm.bind(this);
    }
    handleChange(e) {
        let employee = this.state.Employee;
        employee[e.target.name] = e.target.value;
        this.setState({ Employee: employee });
    }

    componentDidMount() {
        axios.get(process.env.REACT_APP_BASE_URL + "/api/admin/teamleader")
            .then(response => {
                this.setState({
                    employeeList: response.data
                });
            })
    }

    //Submit Form
    submitForm() {

        var thizz = this;
        // Send login request
        axios({
            method: "post",
            url: process.env.REACT_APP_BASE_URL + "/api/admin/teamleader",
            data: thizz.state.Employee,

        }).then(function (response) {
            var data = response.data
            if (data.status === true && data) {
                var resStatus = thizz.state.resStatus;
                resStatus.isError = true;
                resStatus.messages = data.message;
                thizz.setState({ resStatus: resStatus });

                // New table row insert
                thizz.setState({
                    employeeList: [...thizz.state.employeeList, data.row]
                })

                var employee = thizz.state.Employee
                centre = {
                    centre_code :'',
                    centre_name :'',
                    short_name  :""
                }
                thizz.setState({
                    Centre:centre
                })

            }

        }).catch(function (error) {
            console.log(error.response.data.status);
            var data = error.response.data;
            if (error.response.data.status === false) {
                var resStatus = thizz.state.resStatus;
                resStatus.messages = data.message;
                thizz.setState({ resStatus: resStatus });
            }
        });
    }
  render() {
    return (
      <>
      <Header />
                <Sidebar />

                <div className="content-wrapper">
                    {/* Content Header (Page header) */}
                    <div className="content-header">
                        <div className="container-fluid">
                            <div className="row">
                                <div className="col-md-5">

                                    <div className="card card-warning">
                                        <div className="card-header">
                                            <h3 className="card-title text-white">Team Leader Detail</h3>
                                        </div>
                                        <form>
                                            <div className="card-body">
                                                <div className="form-group">
                                                    <label htmlFor="centreCode">Employee Code </label>
                                                    <input type="text" className="form-control" name="centreCode" id="centreCode"  />
                                                </div>
                                                <div className="form-group">
                                                    <label htmlFor="centreCode">Employee Name </label>
                                                    <input type="text" className="form-control" name="centreCode" id="centreCode"  />
                                                </div>


                                            </div>
                                            <div className="card-footer">
                                                <button type="submit" className="btn btn-primary">Submit</button>
